import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  return (
    <div className="expenses">
      {props.items.map((item, idx) => (
        <ExpenseItem
          title={item[idx].title}
          amount={item[idx].amount}
          date={item[idx].date}
        />
      ))}
    </div>
  );
}

export default Expenses;
